package com.nology.ECF;public class Lesson {    private String id;    private String type;    private String title;    private int duration;    private String videoUrl;    private String videoName;    private String videoIconUrl;    private String headingOne;    private String paragraphOne;    private String headingTwo;    private String paragraphTwo;    public Lesson(String id, String type, String title, int duration, String videoUrl, String videoName, String videoIconUrl, String headingOne, String paragraphOne, String headingTwo, String paragraphTwo) {        this.id = id;        this.type = type;        this.title = title;        this.duration = duration;        this.videoUrl = videoUrl;        this.videoName = videoName;        this.videoIconUrl = videoIconUrl;        this.headingOne = headingOne;        this.paragraphOne = paragraphOne;        this.headingTwo = headingTwo;        this.paragraphTwo = paragraphTwo;    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getType() {        return type;    }    public void setType(String type) {        this.type = type;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public int getDuration() {        return duration;    }    public void setDuration(int duration) {        this.duration = duration;    }    public String getVideoUrl() {        return videoUrl;    }    public void setVideoUrl(String videoUrl) {        this.videoUrl = videoUrl;    }    public String getVideoName() {        return videoName;    }    public void setVideoName(String videoName) {        this.videoName = videoName;    }    public String getVideoIconUrl() {        return videoIconUrl;    }    public void setVideoIconUrl(String videoIconUrl) {        this.videoIconUrl = videoIconUrl;    }    public String getHeadingOne() {        return headingOne;    }    public void setHeadingOne(String headingOne) {        this.headingOne = headingOne;    }    public String getParagraphOne() {        return paragraphOne;    }    public void setParagraphOne(String paragraphOne) {        this.paragraphOne = paragraphOne;    }    public String getHeadingTwo() {        return headingTwo;    }    public void setHeadingTwo(String headingTwo) {        this.headingTwo = headingTwo;    }    public String getParagraphTwo() {        return paragraphTwo;    }    public void setParagraphTwo(String paragraphTwo) {        this.paragraphTwo = paragraphTwo;    }}